import{_ as a,a as o,b as r,c as l,d as s,e as t}from"./chunks/walls.B_4epStD.js";import{_ as i,c as d,a8 as n,o as h}from"./chunks/framework.BDnHobkS.js";const z=JSON.parse('{"title":"Gazebo Worlds","description":"","frontmatter":{},"headers":[],"relativePath":"en/sim_gazebo_gz/worlds.md","filePath":"en/sim_gazebo_gz/worlds.md"}'),m={name:"en/sim_gazebo_gz/worlds.md"};function c(f,e,p,b,u,w){return h(),d("div",null,e[0]||(e[0]=[n('<h1 id="gazebo-worlds" tabindex="-1">Gazebo Worlds <a class="header-anchor" href="#gazebo-worlds" aria-label="Permalink to &quot;Gazebo Worlds&quot;">​</a></h1><p>This topic provides imagery/information about the <a href="./../sim_gazebo_gz/">Gazebo</a> worlds supported by PX4.</p><p>The <a href="#default">default world</a> is spawned by default, though this may be overridden by a <a href="#model_specific_worlds">model specific world</a>. Developers can also manually specify the world to load: <a href="./../sim_gazebo_gz/#specify-world">Gazebo &gt; Specify World</a> (or <a href="./../sim_gazebo_gz/gazebo_models.html#gazebo-models-repository-px4-gazebo-models">Gazebo Models Repository</a>).</p><p>The source code for supported worlds can be found in the <a href="./../sim_gazebo_gz/gazebo_models.html#gazebo-models-repository-px4-gazebo-models">Gazebo Models Repository</a> on GitHub here: <a href="https://github.com/PX4/PX4-gazebo-models/tree/main/worlds" target="_blank" rel="noreferrer">PX4/PX4-gazebo-models/tree/main/worlds</a>.</p><h2 id="default" tabindex="-1">Empty (Default) <a class="header-anchor" href="#default" aria-label="Permalink to &quot;Empty (Default) {#default}&quot;">​</a></h2><p>Empty world (a grey plane). This is used by default.</p><p><a href="https://github.com/PX4/PX4-gazebo-models/blob/main/worlds/default.sdf" target="_blank" rel="noreferrer">PX4-gazebo-models/main/worlds/default.sdf</a></p><p><img src="'+a+'" alt="screenshot of default world"></p><h2 id="aruco" tabindex="-1">Aruco <a class="header-anchor" href="#aruco" aria-label="Permalink to &quot;Aruco&quot;">​</a></h2><p>Aruco world is the default world with the addition of an <a href="https://docs.opencv.org/4.x/d5/dae/tutorial_aruco_detection.html" target="_blank" rel="noreferrer">ArUco marker</a>.</p><p>This is used in conjunction with the <a href="./../sim_gazebo_gz/vehicles.html#x500-quadrotor-with-monocular-camera-down-facing">x500_mono_cam_down</a> airframe to test <a href="./../advanced_features/precland.html">precision landing</a>.</p><p><a href="https://github.com/PX4/PX4-gazebo-models/blob/main/worlds/aruco.sdf" target="_blank" rel="noreferrer">PX4-gazebo-models/main/worlds/aruco.sdf</a></p><p><img src="'+o+'" alt="screenshot of Aruco world"></p><h2 id="baylands" tabindex="-1">Baylands <a class="header-anchor" href="#baylands" aria-label="Permalink to &quot;Baylands&quot;">​</a></h2><p>Baylands world surrounded by water.</p><p><a href="https://github.com/PX4/PX4-gazebo-models/blob/main/worlds/baylands.sdf" target="_blank" rel="noreferrer">PX4-gazebo-models/main/worlds/bayland.sdf</a></p><p><img src="'+r+'" alt="Screenshot of Baylands world"></p><h2 id="lawn" tabindex="-1">Lawn <a class="header-anchor" href="#lawn" aria-label="Permalink to &quot;Lawn&quot;">​</a></h2><p>Lawn is a flat green world that is a less-optimized alternative to <a href="#rover">rover world</a>. It is not recommended as the low frame rate causes segmentation faults on some frames.</p><p><a href="https://github.com/PX4/PX4-gazebo-models/blob/main/worlds/lawn.sdf" target="_blank" rel="noreferrer">PX4-gazebo-models/main/worlds/lawn.sdf</a></p><p><img src="'+l+'" alt="screenshot of lawn world"></p><h2 id="rover" tabindex="-1">Rover <a class="header-anchor" href="#rover" aria-label="Permalink to &quot;Rover&quot;">​</a></h2><p>Rover world is optimised for rovers (and will be further optimised for rovers) and is the default world for <a href="./../frames_rover/ackermann.html">Ackermann Rover (4012)</a> (<code>make px4_sitl gz_rover_ackermann</code>) and <a href="./../frames_rover/differential.html">Differential Rover ((r1-rover (4009))</a> (<code>make px4_sitl gz_r1_rover</code>).</p><p><a href="https://github.com/PX4/PX4-gazebo-models/blob/main/worlds/rover.sdf" target="_blank" rel="noreferrer">PX4-gazebo-models/main/worlds/rover.sdf</a></p><p><img src="'+s+'" alt="screenshot of rover world"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Rover world is very similar to <a href="#lawn">lawn world</a>, but with these tow main differences:</p><ul><li>Grid on the ground which is useful as a reference while driving.</li><li>Higher update rate which solves segfault issues specifically with rovers with ackermann steering.</li></ul></div><h2 id="walls" tabindex="-1">Walls <a class="header-anchor" href="#walls" aria-label="Permalink to &quot;Walls&quot;">​</a></h2><p>World with walls that is designed for testing <a href="./../computer_vision/collision_prevention.html">collision prevention</a>.</p><p><a href="https://github.com/PX4/PX4-gazebo-models/blob/main/worlds/walls.sdf" target="_blank" rel="noreferrer">PX4-gazebo-models/main/worlds/walls.sdf</a></p><p><img src="'+t+'" alt="screenshot of walls world"></p><h2 id="windy" tabindex="-1">Windy <a class="header-anchor" href="#windy" aria-label="Permalink to &quot;Windy&quot;">​</a></h2><p><a href="#default">Empty world</a> with wind enabled.</p><p><a href="https://github.com/PX4/PX4-gazebo-models/blob/main/worlds/windy.sdf" target="_blank" rel="noreferrer">PX4-gazebo-models/main/worlds/windy.sdf</a></p><h2 id="model_specific_worlds" tabindex="-1">Model Specific Worlds <a class="header-anchor" href="#model_specific_worlds" aria-label="Permalink to &quot;Model Specific Worlds {#model_specific_worlds}&quot;">​</a></h2><p>Some <a href="./../sim_gazebo_gz/vehicles.html">vehicle models</a> rely on the physics / plugins of a specific world. The PX4 toolchain will automatically spawn a world that has the same name as the vehicle model if one exists (instead of the <a href="#default">default world</a>):</p><p>The model specific worlds are:</p><ul><li><a href="#aruco">Aruco world</a>: Default world with an <a href="https://docs.opencv.org/4.x/d5/dae/tutorial_aruco_detection.html" target="_blank" rel="noreferrer">ArUco marker</a> that can be used with with <a href="./../sim_gazebo_gz/vehicles.html#x500-quadrotor-with-monocular-camera-down-facing">x500_mono_cam_down</a> for testing <a href="./../advanced_features/precland.html">precision landing</a>.</li></ul>',37)]))}const v=i(m,[["render",c]]);export{z as __pageData,v as default};
